import React from 'react';
import ReactDOM from 'react-dom';
import styled, { css } from 'styled-components';
import './Header.css';

const Header = ({ children }) => {
  return (
    <header>
      <h1>{ children }</h1>
    </header>
  )
}

export default Header;
